import React from 'react';

import s from './Advert.module.css'

const Advert = () => {
    return (
        <div>
            <div className={s.container}>
                <div>
                    <img className={s.labelImage} src="" alt=""/>
                    <p className={s.nameAd}>Продам машину</p>
                </div>
                <p className={s.price}>50.000$</p>
                <p className={s.description}>Топ за свои деньги...</p>

            </div>
        </div>
    );
};

export default Advert;
